import React from "react";
import { getGenres } from "../../services/fakeMovieService";
const ListGroup = (props) => {
  const { items } = props;
  return (
    <ul class="list-group">
      {items.map((item) => (
        <li class="list-group-item">All Genres</li>
      ))}
    </ul>
  );
};

export default ListGroup;
